import OpeningFileIcon from './Icons/OpeningFileIcon.jsx';
import ResumeFileIcon from './Icons/ResumeFileIcon.jsx';
import MineSweeperIcon from './Icons/MineSweeperIcon.jsx';
import { IconFileText, IconBomb, IconWall, IconApple } from '@tabler/icons-react';
import OpeningFile from './Files/OpeningFile.jsx';
import Snake from './Files/Snake.jsx';
import MineSweeper from './Files/MineSweeper.jsx';
import the2048 from './Files/2048.jsx';
import FileIcon from './Icons/FileIcon.jsx';

function IconColumn() {
    return (
        <div className="flex flex-col w-32 pt-5 gap-2">
            <FileIcon Icon={IconFileText} Component={OpeningFile} name="Opening.txt" onLoad={true}/>
            <FileIcon Icon={IconFileText} Component={null} name="Resume.txt"/>
            <FileIcon Icon={IconApple} Component={Snake} name="Snake"/>
            <FileIcon Icon={IconBomb} Component={MineSweeper} name="MineSweeper"/>
            <FileIcon Icon={IconWall} Component={the2048} name="2048"/>
        </div>
    )
}

export default IconColumn;
